            "segment": {
              "startIndex": 100,
              "endIndex": 214,
              "text": "### **Sea Otters (The \"Rafters\")**\nSea otters are famous for sleeping in the water, often floating on their backs."
            },
            "groundingChunkIndices": [
              0,
              1,
              2,
              3,
              4,
              5
            ]
          },
          {
            "segment": {
              "startIndex": 215,
              "endIndex": 371,
              "text": "*   **Holding Hands:** To prevent themselves from drifting away from their group or into dangerous open waters, sea otters often hold paws while they sleep."
            },
            "groundingChunkIndices": [
              3,
              0,
              6,
              5
            ]
          },
          {
            "segment": {
              "startIndex": 372,
              "endIndex": 498,
              "text": "*   **Kelp Anchors:** They also wrap themselves in giant kelp or seaweed, which acts as an \"anchor\" to keep them in one place."
            },
            "groundingChunkIndices": [
              6,
              7
            ]
          },
          {
            "segment": {
              "startIndex": 499,
              "endIndex": 638,
              "text": "*   **Rafts:** They sleep in large social groups called \"rafts,\" which can range from just a few individuals to hundreds or even thousands."
            },
            "groundingChunkIndices": [
              8,
              5
            ]
          },
          {
            "segment": {
              "startIndex": 639,
              "endIndex": 730,
              "text": "*   **Duration:** They typically spend about **11 to 12 hours** a day resting and sleeping."
            },
            "groundingChunkIndices": [
              7
            ]
          },
          {
            "segment": {
              "startIndex": 732,
              "endIndex": 847,
              "text": "### **River Otters (The \"Land Sleepers\")**\nUnlike their sea-dwelling cousins, river otters primarily sleep on land."
            },
            "groundingChunkIndices": [
              9,
              10
            ]
          },
          {
            "segment": {
              "startIndex": 968,
              "endIndex": 1066,
              "text": "They are not picky and will often take over abandoned dens of other animals like foxes or beavers."
            },
            "groundingChunkIndices": [
              9
            ]
          }
