            "text": "Stone & Chalk is one of Australia's leading innovation hubs, particularly known for its strong roots in fintech and its expansion into emerging technologies like space, AI, and climate tech. Since its inception in 2015, its residents and alumni have collectively raised over **$3.9 billion** in capital.\n\nBelow are some of the most notable successful startups and scaleups that have been part of the Stone & Chalk community:\n\n### **Major Success Stories & Scaleups**\n*   **Brighte:** A leading Australian fintech that provides a digital platform for affordable payment solutions for solar, batteries, and home improvements. Founder Katherine McConnell is a prominent Stone & Chalk alumna.\n*   **FrankieOne (formerly Frankie Financial):** A high-growth regtech company that provides a single API for banks and fintechs to manage KYC (Know Your Customer), AML (Anti-Money Laundering), and fraud prevention. It was named Fintech Organisation of the Year at the 2024 Finnies Awards.\n*   **Education Perfect:** A major edtech scaleup with a digital learning platform used by over 1.2 million students and 50,000 teachers across 50 countries. They joined the Sydney hub at Tech Central in 2022.\n*   **Kasada:** A cybersecurity firm specializing in bot mitigation and protecting websites from automated attacks. Founder Sam Crowther is a notable alumnus.\n*   **Birchal:** Australia’s leading equity crowdfunding platform. It has been a key player in the Australian investment scene since crowdsourced funding was legalized in 2018.\n\n### **Notable Portfolio & Alumni Companies**\n*   **Ripple:** The global enterprise blockchain company for payments has been listed as a notable company in Stone & Chalk's portfolio.\n*   **Moneytree:** A personal finance app and data platform that has seen significant success in the Asia-Pacific region.\n*   **Wiise:** A cloud-based business management software (ERP) specifically designed for the Australian market, built on Microsoft Dynamics 365.\n*   **Locad:** A logistics engine for e-commerce that recently raised $9 million in pre-Series B funding to expand its storage and shipping services.\n*   **Sitemate:** A construction tech company that recently acquired **Nomad** (another startup) to expand its digital platform for field-based industries.\n\n### **Emerging Leaders (2024-2025)**\n*   **Build Club:** An AI talent training campus that recently raised $1.75 million. Founder Annie Liao was featured on the Forbes Australia 30 Under 30 list.\n*   **Andromeda Robotics:** Led by alumna Grace Brown, this startup builds humanoid robot companions designed to support older Australians in aged care.\n*   **Cropify:** An Adelaide-based agtech startup that secured $2 million in funding to use AI for grading grain, helping farmers increase efficiency and reduce carbon emissions.\n*   **Blue Dwarf:** A space-tech startup helping companies navigate the complex regulations of launching satellites and rockets.\n\n### **Key Statistics**\n*   **Total Capital Raised:** Over $3.9 billion by residents and alumni.\n*   **Job Creation:** Current companies employ over 4,500 people.\n*   **Community Size:** Over 515 startups across hubs in Sydney, Melbourne, and Adelaide.",
