            "text": "The Melbourne Accelerator Program (MAP), established in 2012 at the University of Melbourne, has supported over 100 startups that have collectively raised hundreds of millions in funding and created thousands of jobs.

Below are some of the most notable and successful startups to have graduated from the program:

### **High-Growth & Scale-Up Successes**
*   **Nura:** Known for their personalized sound technology, Nura raised over $1.8 million on Kickstarter (the largest Australian campaign at the time) and has since become a global brand in the audio industry.
*   **Acusensus:** A world leader in road safety technology, they developed a camera system that uses AI to detect drivers using mobile phones. They have successfully listed on the ASX (ASX: ACE).
*   **Relectrify:** A leader in battery control technology, Relectrify specializes in repurposing "second-life" electric vehicle batteries for household and industrial energy storage. They have raised significant Series A funding (over $26M) and partnered with major global energy companies.
*   **Carbar:** Australia’s first car subscription platform. The company has seen massive growth and secured a major investment from IAG (Insurance Australia Group) to scale its operations nationwide.
*   **Brosa:** An "internet-first" designer furniture brand that disrupted the traditional retail model. It grew into one of Australia's most recognizable e-commerce success stories before being acquired by Kogan.com.

### **Specialized & Deep Tech Leaders**
*   **PHORIA:** An immersive technology studio that has worked with global giants like Google, Netflix, and Disney. They are pioneers in augmented and virtual reality (AR/VR) experiences.
*   **Kepler Analytics:** Provides sensor-based foot traffic analytics for retailers. Their technology is used by major brands globally to optimize store performance and customer behavior insights.
*   **Smileyscope:** A health-tech company that uses virtual reality to reduce pain and anxiety for children during medical procedures (like vaccinations). Their technology is now used in hospitals worldwide.
*   **Allume Energy:** Developed the "SolShare" technology, which allows solar energy from a single rooftop system to be shared across multiple apartments in the same building—a first-of-its-kind solution for the multi-residential market.

### **Social Impact & Niche Innovators**
*   **Bardee:** A circular economy startup that uses black soldier fly larvae to convert food waste into high-quality protein and fertilizer, significantly reducing carbon emissions.
*   **BindiMaps:** An award-winning indoor navigation app designed to help people who are blind or vision-impaired navigate complex indoor spaces like shopping centers and hospitals.
*   **Atticus:** A legal-tech platform used by top-tier law firms and corporations to streamline the verification of complex disclosure documents (like IPO prospectuses).

### **Key Stats of the Program**
*   **Founded:** 2012
*   **Equity:** MAP is notable for being **equity-free**, meaning they do not take a stake in the companies they support.
*   **Ranking:** It has previously been ranked as one of the top university-affiliated accelerators in the world by UBI Global.",
