            "text": "Antler Australia has backed over 100 startups since its launch in 2019, with several achieving significant commercial traction, multi-million dollar funding rounds, or successful exits.\n\n### **Top Performing & Notable Alumni**\nThese companies are frequently cited as success stories due to their rapid growth and ability to secure follow-on capital from top-tier VCs like AirTree, Tidal, and Folklore.\n\n*   **Tactiq:** A Chrome extension that provides real-time transcription for Google Meet and Zoom. It has seen explosive global growth, reaching millions of users and becoming one of Antler's most successful AI-driven portfolio companies.\n*   **Upcover:** A specialized insurance platform for the gig economy and small businesses. It has raised significant capital (including a $4.7M round) to simplify insurance for contractors and freelancers.\n*   **Pathzero:** A climate tech platform that helps companies manage and report their carbon emissions. It has become a leader in the Australian sustainability tech space, securing millions in funding to expand its carbon management tools.\n*   **Xailient:** A deep-tech startup focused on \"Edge AI,\" making computer vision faster and more efficient for IoT devices. It is recognized for its advanced technical IP and global enterprise partnerships.\n*   **Trace:** A sustainability platform that helps businesses measure, reduce, and offset their carbon footprint. It has gained significant traction among Australian SMEs looking to achieve net-zero goals.\n*   **QuickaPay:** A fintech platform providing \"Buy Now, Pay Later\" services for B2B invoices. It is notable for being Antler Australia's **first successful exit**, having been acquired by a larger financial services player.\n*   **Sapyen:** A health-tech startup focused on male fertility testing. It has been highlighted for its strong commercial momentum and successful fundraising, with the CEO noting that a significant portion of their capital was raised through Antler's network.\n\n### **Rising Stars (2024–2025)**\nRecent cohorts have produced several high-potential startups that have already secured pre-seed or seed funding:\n\n*   **Auric:** Named **Australian Startup of the Year 2024** by the Startup Network. It uses AI and science to create personalized aromatherapy rituals and has projected a run rate of over $1M ARR.\n*   **Enrola:** An education comparison and enrollment platform that recently announced an $800,000 pre-seed round.\n*   **FOBOH:** A B2B wholesale platform for the beverage industry that has seen rapid adoption by suppliers and venues.\n*   **Altai:** A legal-tech platform that has gained attention for its AI-driven approach to contract management and legal workflows.\n\n### **Key Success Metrics**\n*   **Funding:** Over 75% of Antler Australia's portfolio companies typically raise third-party capital within six months of their Demo Day.\n*   **Valuation:** As of late 2022, at least 12 portfolio companies were valued at over $10 million.\n*   **New Fund:** Antler recently closed a **$77 million second Australian fund** (2024) to back another 100+ startups, indicating strong investor confidence in the accelerator's local track record.",
