            "text": "Cicada Innovations is Australia’s longest-running deep tech incubator and has been twice named the "Top Incubator in the World" by the International Business Innovation Association (InBIA). Since its founding in 2000, it has nurtured over 300 companies that have collectively raised more than $6.5 billion in capital and generated over $8 billion in economic value.

Below are some of the most notable and successful startups to emerge from Cicada Innovations:

### **1. Morse Micro (Semiconductors & IoT)**
Morse Micro is one of Cicada’s most high-profile success stories. They are the pioneers of **Wi-Fi HaLow** (802.11ah), a long-range, low-power Wi-Fi standard designed specifically for the Internet of Things (IoT).
*   **Success Metric:** Recently closed an **$88 million Series C** funding round to fuel international expansion and scale production.

### **2. Regrow Ag (formerly FluroSat) (AgTech)**
Regrow is a global leader in "Resilient Agriculture." They provide a software platform that helps food and retail brands (like General Mills and Kellogg’s) reduce their carbon footprint by monitoring and verifying sustainable farming practices.
*   **Success Metric:** They have raised over **$50 million** and are widely considered one of the most successful AgTech startups to come out of Australia.

### **3. Clarity Pharmaceuticals (HealthTech/Biotech)**
A clinical-stage radiopharmaceutical company developing next-generation products for the treatment of cancer. They focus on "theranostics"—using the same agent for both imaging and treating disease.
*   **Success Metric:** Listed on the ASX (ASX: CU6) in 2021 with a **$92 million IPO**, the largest ever for an Australian biotech at the time.

### **4. Propeller Aero (Drones & Construction)**
Propeller Aero provides a cloud-based data visualization and analytics platform for the construction, mining, and waste management industries. Their technology uses drone data to create highly accurate 3D maps of worksites.
*   **Success Metric:** They have expanded globally with offices in Denver and Sydney, raising over **$30 million** from top-tier investors like Blackbird Ventures and Costanoa Ventures.

### **5. SpeeDx (MedTech/Diagnostics)**
SpeeDx develops molecular diagnostic solutions that not only detect infectious diseases but also identify antibiotic resistance, allowing for "resistance-guided therapy."
*   **Success Metric:** Their tests are sold globally, and they have secured significant strategic partnerships and investment from global giants like Roche.

### **6. Samsara Eco (Sustainability/EnviroTech)**
Samsara Eco uses advanced enzyme technology to break down plastic waste (including complex plastics like nylon and polyester) into its original chemical building blocks, allowing for infinite recycling.
*   **Success Metric:** Raised **$100 million** in 2024 to scale their technology and build commercial-scale recycling facilities.

### **7. Elastagen (Biotech - Exit)**
Elastagen developed a breakthrough "synthetic skin" technology based on tropoelastin (the building block of elastin in human tissue) to treat scars and repair skin.
*   **Success Metric:** Acquired by the global pharmaceutical giant **Allergan** (the makers of Botox) in 2018 for an undisclosed sum, estimated to be one of the largest biotech exits in Australian history.

### **Other Notable Alumni & Residents:**
*   **Bugcrowd:** A global leader in crowdsourced cybersecurity and "bug bounty" programs.
*   **Gelion:** A renewable energy storage company specializing in zinc-bromide batteries (listed on the London Stock Exchange).
*   **SkyDrop (formerly Flirtey):** A pioneer in drone delivery technology, being the first to complete an FAA-approved drone delivery in the US.
