          {
            "segment": {
              "startIndex": 794,
              "endIndex": 995,
              "text": "2.  **The Methodology:** Based on George Pólya’s 1945 book *How to Solve It*, the \"Solveit way\" emphasizes understanding the problem, devising a plan, and carrying it out in small, verifiable steps."
